      "message": "–ó–∞–≤–æ–¥, —Å¬†–∫–æ—Ç–æ—Ä—ã–º —Å–æ—Ç—Ä—É–¥–Ω–∏—á–∞–µ—Ç –∫–æ–º–ø–∞–Ω–∏—è –º—É–∂–∞ –ø—Ä–µ–º—å–µ—Ä-–º–∏–Ω–∏—Å—Ç—Ä–∞ –≠—Å—Ç–æ–Ω–∏–∏, –Ω–∞—Ö–æ–¥–∏—Ç—Å—è –≤¬†–ü–µ—Ç–µ—Ä–±—É—Ä–≥–µ –∏¬†–¥–æ¬†—Å–∏—Ö –ø–æ—Ä —Ä–∞–±–æ—Ç–∞–µ—Ç. –¢–∞–º –ø–æ–±—ã–≤–∞–ª–∏ –∂—É—Ä–Ω–∞–ª–∏—Å—Ç—ã ¬´–ë—É–º–∞–≥–∏¬ª. –ß—Ç–æ –µ—â–µ —Å—Ç–∞–ª–æ –∏–∑–≤–µ—Å—Ç–Ω–æ –æ¬†—Å–≤—è–∑—è—Ö –ø—Ä–µ–¥–ø—Ä–∏—è—Ç–∏—è —Å¬†—Å–µ–º—å–µ–π –ö–∞–∏ –ö–∞–ª–ª–∞—Å\n\n–° –∞–≤–≥—É—Å—Ç–∞ –≤ –≠—Å—Ç–æ–Ω–∏–∏ –ø—Ä–∏–∑—ã–≤–∞—é—Ç –ø—Ä–µ–º—å–µ—Ä-–º–∏–Ω–∏—Å—Ç—Ä–∞ —Å—Ç—Ä–∞–Ω—ã –ö–∞—é –ö–∞–ª–ª–∞—Å —É–π—Ç–∏ –≤ –æ—Ç—Å—Ç–∞–≤–∫—É –∏–∑-–∑–∞ –±–∏–∑–Ω–µ—Å-—Å–≤—è–∑–µ–π –µ–µ —Å–µ–º—å–∏ —Å –†–æ—Å—Å–∏–µ–π: —Ç—Ä–∞–Ω—Å–ø–æ—Ä—Ç–Ω–∞—è –∫–æ–º–ø–∞–Ω–∏—è Stark Logistics, —á–∞—Å—Ç–∏—á–Ω–æ –ø—Ä–∏–Ω–∞–¥–ª–µ–∂–∞—â–∞—è –º—É–∂—É –ø–æ–ª–∏—Ç–∏–∫–∞ –ê—Ä–≤–æ –•–∞–ª–ª–∏–∫—É, –ø—Ä–æ–¥–æ–ª–∂–∏–ª–∞ –ø–æ—Å—Ç–∞–≤–∫–∏ –≤ –†–§ –≤–æ –≤—Ä–µ–º—è –≤–æ–π–Ω—ã –≤ –£–∫—Ä–∞–∏–Ω–µ.\n\n–ü–æ—Å–ª–µ —Ç–æ–≥–æ –∫–∞–∫ –æ–± —ç—Ç–æ–º —Å—Ç–∞–ª–æ –∏–∑–≤–µ—Å—Ç–Ω–æ, –ö–∞–ª–ª–∞—Å –ø—Ä–∏–Ω–µ—Å–ª–∞ –ø—É–±–ª–∏—á–Ω—ã–µ –∏–∑–≤–∏–Ω–µ–Ω–∏—è (–∏ –æ—Ç–∫–∞–∑–∞–ª–∞—Å—å –ø–æ–∫–∏–¥–∞—Ç—å –ø–æ—Å—Ç), –∞ –•–∞–ª–ª–∏–∫ –ø–æ–æ–±–µ—â–∞–ª –ø—Ä–æ–¥–∞—Ç—å –¥–æ–ª—é –≤ –ø—Ä–µ–¥–ø—Ä–∏—è—Ç–∏–∏. –ü–∞—Ä—Ç–∏—è —Ä–µ—Ñ–æ—Ä–º, –∫–æ—Ç–æ—Ä—É—é –≤–æ–∑–≥–ª–∞–≤–ª—è–µ—Ç –ö–∞–ª–ª–∞—Å, –Ω–∞–º–µ—Ä–µ–Ω–∞ –æ–±—Å—É–¥–∏—Ç—å —Å–∏—Ç—É–∞—Ü–∏—é 8 —Å–µ–Ω—Ç—è–±—Ä—è. –¢–µ–º –≤—Ä–µ–º–µ–Ω–µ–º –∂—É—Ä–Ω–∞–ª–∏—Å—Ç—ã ¬´–ë—É–º–∞–≥–∏¬ª (@paperpaper_ru) –∏ —ç—Å—Ç–æ–Ω—Å–∫–∏—Ö –∏–∑–¥–∞–Ω–∏–π ¬´–î–µ–ª–æ–≤—ã–µ –≤–µ–¥–æ–º–æ—Å—Ç–∏¬ª –∏ √Ñrip√§ev –Ω–∞—à–ª–∏ –≤ –ö—Ä–∞—Å–Ω–æ–º –°–µ–ª–µ –∑–∞–≤–æ–¥, –Ω–µ–ø–æ—Å—Ä–µ–¥—Å—Ç–≤–µ–Ω–Ω–æ —Å–≤—è–∑–∞–Ω–Ω—ã–π —Å–æ Stark Logistics –∏ —Ä–∞–±–æ—Ç–∞—é—â–∏–π –¥–æ —Å–∏—Ö –ø–æ—Ä.\n\n–° —Ä–∞–∑—Ä–µ—à–µ–Ω–∏—è —Ä–µ–¥–∞–∫—Ü–∏–∏ ¬´–ë—É–º–∞–≥–∏¬ª ¬´–ú–µ–¥—É–∑–∞¬ª –ø—É–±–ª–∏–∫—É–µ—Ç –º–∞—Ç–µ—Ä–∏–∞–ª —Ü–µ–ª–∏–∫–æ–º —Å –Ω–µ–∑–Ω–∞—á–∏—Ç–µ–ª—å–Ω—ã–º–∏ –∏–∑–º–µ–Ω–µ–Ω–∏—è–º–∏.",
