      "message": "–ù–ê–¢–û –æ—Ç—Ä–µ–ø–µ—Ç–∏—Ä—É–µ—Ç –≤–æ–π–Ω—É —Å –†–æ—Å—Å–∏–µ–π –≤ –ë–∞–ª—Ç–∏–π—Å–∫–æ–º –º–æ—Ä–µ\n\n–í –ë–∞–ª—Ç–∏–π—Å–∫–æ–º –º–æ—Ä–µ –Ω–∞—á–Ω—É—Ç—Å—è –º–∞—Å—à—Ç–∞–±–Ω—ã–µ –º–æ—Ä—Å–∫–∏–µ —É—á–µ–Ω–∏—è Northern Coasts, –≤ –∫–æ—Ç–æ—Ä—ã—Ö –ø—Ä–∏–º—É—Ç —É—á–∞—Å—Ç–∏–µ –æ–∫–æ–ª–æ 30 –∫–æ—Ä–∞–±–ª–µ–π –∏ –±–æ–ª–µ–µ 3 000 –≤–æ–µ–Ω–Ω–æ—Å–ª—É–∂–∞—â–∏—Ö —Å—Ç—Ä–∞–Ω –ó–∞–ø–∞–¥–∞. –û–Ω–∏ –≤–ø–µ—Ä–≤—ã–µ –±—É–¥—É—Ç –æ—Ç—Ä–∞–±–∞—Ç—ã–≤–∞—Ç—å –¥–µ–π—Å—Ç–≤–∏—è –≤ –æ—Ç–≤–µ—Ç –Ω–∞ –≤–æ–∑–º–æ–∂–Ω–æ–µ –≤—Ç–æ—Ä–∂–µ–Ω–∏–µ –†–æ—Å—Å–∏–∏ –≤ —Ä–µ–≥–∏–æ–Ω, —Ä–∞—Å—Å–∫–∞–∑–∞–ª –Ω–∞—á–∞–ª—å–Ω–∏–∫ –í–æ–µ–Ω–Ω–æ-–º–æ—Ä—Å–∫–æ–≥–æ —Ñ–ª–æ—Ç–∞ –ì–µ—Ä–º–∞–Ω–∏–∏ –≤–∏—Ü–µ-–∞–¥–º–∏—Ä–∞–ª –Ø–Ω –ö—Ä–∏—Å—Ç–∏–∞–Ω –ö–∞–∞–∫, –∫–æ—Ç–æ—Ä–æ–≥–æ —Ü–∏—Ç–∏—Ä—É–µ—Ç Reuters.\n\n¬´–ú—ã –ø–æ—Å—ã–ª–∞–µ–º –†–æ—Å—Å–∏–∏ —á–µ—Ç–∫–æ–µ —Å–æ–æ–±—â–µ–Ω–∏–µ –æ –±–¥–∏—Ç–µ–ª—å–Ω–æ—Å—Ç–∏: –Ω–∏—á—Ç–æ –Ω–µ –ø—Ä–æ–π–¥–µ—Ç –Ω–µ–∑–∞–º–µ—á–µ–Ω–Ω—ã–º. –ù–∞–¥–µ–∂–Ω–æ–µ —Å–¥–µ—Ä–∂–∏–≤–∞–Ω–∏–µ –¥–æ–ª–∂–Ω–æ –≤–∫–ª—é—á–∞—Ç—å –≤ —Å–µ–±—è —Å–ø–æ—Å–æ–±–Ω–æ—Å—Ç—å –∞—Ç–∞–∫–æ–≤–∞—Ç—å¬ª, ‚Äî —Å–∫–∞–∑–∞–ª –≤–∏—Ü–µ-–∞–¥–º–∏—Ä–∞–ª –ö–∞–∞–∫ –Ω–∞ –ø—Ä–µ—Å—Å-–∫–æ–Ω—Ñ–µ—Ä–µ–Ω—Ü–∏–∏ –≤ –ë–µ—Ä–ª–∏–Ω–µ.\n\n–£—á–µ–Ω–∏—è Northern Coasts –Ω–∞—á–Ω—É—Ç—Å—è 9 —Å–µ–Ω—Ç—è–±—Ä—è –∏ –ø—Ä–æ–¥–ª—è—Ç—Å—è –¥–≤–µ –Ω–µ–¥–µ–ª–∏. –í –Ω–∏—Ö –ø—Ä–∏–º—É—Ç —É—á–∞—Å—Ç–∏–µ –≤–æ–µ–Ω–Ω–æ—Å–ª—É–∂–∞—â–∏–µ –≤—Å–µ—Ö —Å—Ç—Ä–∞–Ω –ù–ê–¢–û, –∏–º–µ—é—â–∏—Ö –≤—ã—Ö–æ–¥ –∫ –ë–∞–ª—Ç–∏–π—Å–∫–æ–º—É –º–æ—Ä—é, –∞ —Ç–∞–∫–∂–µ –®–≤–µ—Ü–∏–∏, –°–®–ê, –ö–∞–Ω–∞–¥—ã, –ù–∏–¥–µ—Ä–ª–∞–Ω–¥–æ–≤, –ë–µ–ª—å–≥–∏–∏ –∏ –§—Ä–∞–Ω—Ü–∏–∏. –û–¥–Ω–∏–º –∏–∑ –ø—Ä–∏–æ—Ä–∏—Ç–µ—Ç–æ–≤ —É—á–µ–Ω–∏–π –±—É–¥–µ—Ç –æ–±–µ—Å–ø–µ—á–µ–Ω–∏–µ –±–µ–∑–æ–ø–∞—Å–Ω–æ—Å—Ç–∏ –º–æ—Ä—Å–∫–∏—Ö –º–∞—Ä—à—Ä—É—Ç–æ–≤ —á–µ—Ä–µ–∑ –ë–∞–ª—Ç–∏–π—Å–∫–æ–µ –º–æ—Ä–µ, –∫–æ—Ç–æ—Ä—ã–µ –ø—Ä–æ—Ö–æ–¥—è—Ç —É –ø–æ–±–µ—Ä–µ–∂–∏–π –õ–∞—Ç–≤–∏–∏ –∏ –≠—Å—Ç–æ–Ω–∏–∏.\n\n–í —Ö–æ–¥–µ –º–∞–Ω–µ–≤—Ä–æ–≤ –±—É–¥—É—Ç –æ—Ç—Ä–∞–±–∞—Ç—ã–≤–∞—Ç—å—Å—è –∞–º—Ñ–∏–±–∏–π–Ω—ã–µ –æ–ø–µ—Ä–∞—Ü–∏–∏ ‚Äî —É–¥–∞—Ä—ã –∏ –≤—ã—Å–∞–¥–∫–∏ –¥–µ—Å–∞–Ω—Ç–∞ —Å –º–æ—Ä—è –Ω–∞ —Å—É—à—É. –ù–∞ —É—á–µ–Ω–∏—è –Ω–∞–ø—Ä–∞–≤–ª–µ–Ω –∞–º–µ—Ä–∏–∫–∞–Ω—Å–∫–∏–π –¥–µ—Å–∞–Ω—Ç–Ω—ã–π —Ç—Ä–∞–Ω—Å–ø–æ—Ä—Ç–Ω—ã–π –∫–æ—Ä–∞–±–ª—å-–¥–æ–∫ –∫–ª–∞—Å—Å–∞ Mesa Verde, –¥–ª–∏–Ω–æ–π –±–æ–ª–µ–µ 200 –º–µ—Ç—Ä–æ–≤. –û–Ω –ø—Ä–µ–¥–Ω–∞–∑–Ω–∞—á–µ–Ω –¥–ª—è –ø–µ—Ä–µ–≤–æ–∑–∫–∏ –∏ –≤—ã—Å–∞–¥–∫–∏ –æ–∫–æ–ª–æ 800 –º–æ—Ä—Å–∫–∏—Ö –ø–µ—Ö–æ—Ç–∏–Ω—Ü–µ–≤.\n\n¬´–§–∏–Ω–ª—è–Ω–¥–∏—è –∏ —Å—Ç—Ä–∞–Ω—ã –ë–∞–ª—Ç–∏–∏ –ø—Ä–∞–∫—Ç–∏—á–µ—Å–∫–∏ –Ω–∞ 100% –∑–∞–≤–∏—Å—è—Ç –æ—Ç –º–æ—Ä—Å–∫–∏—Ö –º–∞—Ä—à—Ä—É—Ç–æ–≤ —á–µ—Ä–µ–∑ –ë–∞–ª—Ç–∏–π—Å–∫–æ–µ –º–æ—Ä–µ. –ï—Å–ª–∏ –±—ã –°—É–≤–∞–ª–∫—Å–∫–∏–π –∫–æ—Ä–∏–¥–æ—Ä –æ–∫–∞–∑–∞–ª—Å—è –∑–∞–±–ª–æ–∫–∏—Ä–æ–≤–∞–Ω ‚Äî —á—Ç–æ –ª–µ–≥–∫–æ –æ—Å—É—â–µ—Å—Ç–≤–∏–º–æ, —Ç–∞–∫ –∫–∞–∫ —Å—É—â–µ—Å—Ç–≤—É—é—Ç –≤—Å–µ–≥–æ –¥–≤–µ –¥–æ—Ä–æ–≥–∏ –∏ –æ–¥–Ω–∞ –∂–µ–ª–µ–∑–Ω–æ–¥–æ—Ä–æ–∂–Ω–∞—è –ª–∏–Ω–∏—è, ‚Äî —Ç–æ —É –Ω–∞—Å –æ—Å—Ç–∞–Ω—É—Ç—Å—è —Ç–æ–ª—å–∫–æ –º–æ—Ä—Å–∫–∏–µ –º–∞—Ä—à—Ä—É—Ç—ã, –∏ –Ω–∞–º –ø—Ä–∏–¥–µ—Ç—Å—è –ø—Ä–æ–∫–ª–∞–¥—ã–≤–∞—Ç—å –ø—É—Ç—å —á–µ—Ä–µ–∑ –Ω–∏—Ö¬ª, ‚Äî –æ—Ç–º–µ—Ç–∏–ª –≤–∏—Ü–µ-–∞–¥–º–∏—Ä–∞–ª –ö–∞–∞–∫.\n\nüòÄ–ü–æ–¥–ø–∏—Å–∞—Ç—å—Å—è –Ω–∞ –∫–∞–Ω–∞–ª | –ü–æ–¥–ø–∏—Å–∞—Ç—å—Å—è –Ω–∞ —Ä–∞—Å—Å—ã–ª–∫—É",
